RESOURCE  resECHO:inflow=300:outflow=0.01
RESOURCE  resNOT:inflow=33:outflow=0.01
RESOURCE resNAND:inflow=33:outflow=0.01
RESOURCE  resAND:inflow=33:outflow=0.01


REACTION  ECHO echo  process:resource=resECHO:value=1.0:frac=0.0025:type=pow requisite:max_tot_count=2:max=10.0
REACTION  NOT  not   process:resource=resNOT:value=1.0:frac=0.0025:type=pow requisite:max_tot_count=2:max=10.0
REACTION  NAND nand  process:resource=resNAND:value=1.0:frac=0.0025:type=pow requisite:max_tot_count=2:max=10.0
REACTION  AND  and   process:resource=resAND:value=1.0:frac=0.0025:type=pow requisite:max_tot_count=2:max=10.0
